Everyday, Yurizan practices tennis. When she started, she wasn't too  good, but these days, she's looking like a pro. Her coach Jordan shows  up to check on his student. He's pretty impressed, but it takes more  than a couple nice volleys to impress Jordan Ash. Yurizan can see the  way he looks at her, and she knows exactly what to do to wow him. Time  to show him her ball handling skills.
